\title{Unveiling Hidden Patterns: Symbolic Glyph Clustering for Enhanced PolyRule Reasoning}

\author{Anonymous}

\begin{document}

\maketitle

\begin{abstract}
Symbolic Pattern Recognition (SPR) involves deciphering abstract sequences subject to hidden structural rules and has broad implications for machine learning systems requiring interpretability. We investigate whether clustering symbolic glyphs based on latent feature representations can improve accuracy and generalization in Synthetic PolyRule Reasoning (SPR). Specifically, we cluster glyphs using K-means \citep{hartigan1979akc} on latent shape-color encodings and leverage a downstream model to reason over clustered sequences. Our results on the SPR\_BENCH dataset surpass the previous State-of-the-Art in Color-Weighted Accuracy (70.0\% to 79.51\%) and Shape-Weighted Accuracy (65.0\% to 79.68\%). We further adopt a recurrent reasoning model \citep{cho2014learningpr} on sequences of cluster IDs and observe even higher performance, though we encountered data visualization pitfalls (e.g., empty plots). These insights can guide future research and avoid repeat missteps.
\end{abstract}

\section{Introduction}
Symbolic reasoning tasks are crucial for interpretability in machine learning workflows, as purely subsymbolic approaches often obscure the latent patterns being modeled \citep{pasupuleti2025cognitivead}. In Synthetic PolyRule Reasoning (SPR), each sequence contains shape-color glyphs and a hidden compositional rule. Achieving robust performance can be challenging when the rules are intricate or confounded by noise.

Inspired by prior symbolic reasoning efforts \citep{nazarczuk2020shopvrbav}, we hypothesize that first clustering individual glyphs with latent embeddings can unveil salient substructures, potentially enhancing rule extraction. Our study focuses on answering whether clustering symbolic glyphs improves performance on SPR\_BENCH and yields deeper insight into symbolic tasks. We present results from two pipelines: (1) a baseline bag-of-cluster-histograms approach, and (2) a more refined sequential model. While our experiments exceed existing accuracy benchmarks, we also highlight pitfalls such as empty metric plots, offering cautionary takeaways.

\section{Related Work}
Symbolic and neuro-symbolic learning systems \citep{goodfellow2016deep, pasupuleti2025cognitivead} have explored the fusion of symbolic structures with deep networks. Clustering has widely been used to group related items for improved representation learning \citep{hartigan1979akc, shutaywi2021silhouetteaf}, although it is rarely applied to discrete glyph sequences for abstract rule reasoning. Pre-trained encoders like BERT \citep{devlin2019bertpo} have shown effectiveness for embedding tokens, but their use in abstract symbolic tasks remains under-explored. Weighted accuracy metrics \citep{uddin2019addressingap} also demonstrate utility when straightforward accuracy obscures important variations in data.

\section{Method}
We propose a two-stage pipeline. First, we convert glyphs (shape-color pairs) into integer vectors via label encoding. Next, we cluster these vectors using K-means, forming $K$ centroid groups. Each sequence is converted into either (1) a histogram of cluster counts, or (2) a sequence of cluster IDs. When employing the histogram representation, a simple feed-forward network predicts the label. For the sequential variant, a bidirectional GRU \citep{cho2014learningpr} processes cluster ID sequences, concluding in a linear classifier. Silhouette analysis \citep{shutaywi2021silhouetteaf} is used to monitor cluster quality. Color-Weighted Accuracy (CWA) and Shape-Weighted Accuracy (SWA) \citep{uddin2019addressingap} are then computed to evaluate performance.

\section{Experimental Setup}
We use the publicly available SPR\_BENCH from HuggingFace, which comprises train, dev, and test splits. Our figures show \textbf{compared cluster sizes} $K\in\{4,8,16,32\}$, revealing strong improvements with larger $K$. In the second stage, we fix $K=32$ and train a GRU-based classifier over three epochs. We track BCE loss and multiple weighted accuracy metrics. We discovered that certain bar charts produced empty visualizations for specific cluster settings (e.g., final CWA at $k=4$), signifying a potentially overlooked bug in the logging script. Overall, training was stable, but the partial failures in metric plotting underscore the fragility of large-scale scripted pipelines.

\section{Experiments}
\noindent \textbf{Baseline Histogram Clustering.} 
At $K=32$, our baseline approach surpassed 70.0\% CWA and 65.0\% SWA, reaching about 79.51\% and 79.68\% respectively. \cref{fig:baseline} illustrates the validation loss trends and complexity-weighted accuracy for different $K$ values, suggesting that fine-grained clusters help capture symbolic nuances.

\begin{figure}[t]
\centering
\subfigure[Validation Loss for various $K$]{\includegraphics[width=0.4\textwidth]{baseline_val_loss.png}}
\hfill
\subfigure[Validation CompWA for various $K$]{\includegraphics[width=0.4\textwidth]{baseline_val_compwa.png}}
\caption{Sample Baseline Results. Clustering with larger $K$ yields improved performance.}
\label{fig:baseline}
\end{figure}

\noindent \textbf{Sequential GRU Model.} 
Building on the histogram baseline, we adapt a GRU to process sequences of cluster IDs directly. This approach further boosts CWA to 98.33\% and SWA to 98.29\%. \cref{fig:research} captures the consistent decrease in loss and concurrent increase in weighted accuracies. Though these results far exceed prior performance, they highlight a discrepancy: whereas the final bar charts for $K=4$ remained empty in earlier runs, subsequent logs were unaffected. Such anomalies emphasize the importance of robust logging.

